class Nationality_model {
  Nationality_model({
    int? status,
    dynamic error,
    Messages? messages,
    String? categoryBaseUrl,
    List<Country_list>? countryList,
  }) {
    _status = status;
    _error = error;
    _messages = messages;
    _categoryBaseUrl = categoryBaseUrl;
    _countryList = countryList;
  }

  Nationality_model.fromJson(dynamic json) {
    _status = json['status'];
    _error = json['error'];
    _messages =
        json['messages'] != null ? Messages.fromJson(json['messages']) : null;
    _categoryBaseUrl = json['category_base_url'];
    if (json['country_list'] != null) {
      _countryList = [];
      json['country_list'].forEach((v) {
        _countryList?.add(Country_list.fromJson(v));
      });
    }
  }
  int? _status;
  dynamic _error;
  Messages? _messages;
  String? _categoryBaseUrl;
  List<Country_list>? _countryList;

  int? get status => _status;
  dynamic get error => _error;
  Messages? get messages => _messages;
  String? get categoryBaseUrl => _categoryBaseUrl;
  List<Country_list>? get countryList => _countryList;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = _status;
    map['error'] = _error;
    if (_messages != null) {
      map['messages'] = _messages?.toJson();
    }
    map['category_base_url'] = _categoryBaseUrl;
    if (_countryList != null) {
      map['country_list'] = _countryList?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

